import{_ as r,a as i,b as o}from"./chunks/fun_cub_aluminium_frame_for_vtol_mounted.BLSwwg7E.js";import{_ as n}from"./chunks/px4_frame_generic_standard_vtol.DtiC4H-Q.js";import{_ as l,c as d,a8 as u,j as t,a,o as s}from"./chunks/framework.BDnHobkS.js";const k=JSON.parse('{"title":"FunCub QuadPlane (Pixhawk)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md","filePath":"uk/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md"}'),h={name:"uk/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md"};function p(c,e,f,_,m,g){return s(),d("div",null,e[0]||(e[0]=[u('<h1 id="funcub-quadplane-pixhawk" tabindex="-1">FunCub QuadPlane (Pixhawk) <a class="header-anchor" href="#funcub-quadplane-pixhawk" aria-label="Permalink to &quot;FunCub QuadPlane (Pixhawk)&quot;">​</a></h1><p>QuadPlane VTOL Fun Cub є стандартним повітряним судном з хвостовим оперенням (Multiplex FunCub), яке було модернізовано з системою QuadCopter.</p><p>Основна Інформація:</p><ul><li><strong>Frame:</strong> Multiplex FunCub</li><li><strong>Flight controller:</strong> Pixhawk</li></ul><p><img src="'+r+'" alt="Fun Cub VTOL"></p><p>Без змін, Fun Cub - це відносно доступний літак і відносно легкий у польоті. Після конвертації літак стає значно важчим і менш аеродинамічним. Він все ще досить добре літає, але потребує близько 75% газу у польоті вперед.</p><h2 id="специфікація-матеріалів" tabindex="-1">Специфікація матеріалів <a class="header-anchor" href="#специфікація-матеріалів" aria-label="Permalink to &quot;Специфікація матеріалів&quot;">​</a></h2><p>Справжній літак приблизно виглядає так, як показано на зображенні вище (інші схожі моделі також підійдуть добре - це Multiplex Fun Cub).</p><p>Мінімально необхідне обладнання:</p><ul><li>Multiplex FunCub (або подібний)</li><li>Pixhawk або сумісний</li><li>Цифровий датчик швидкості польоту</li><li>900 кВ двигуни (наприклад, комплект пропульсії Iris - двигуни та регулятори швидкості)</li><li>10&quot; пропелери для квадрокоптерів (10х45 або 10х47)</li><li>10&quot; гвинт для мотора фіксованого крила (10×7)</li><li>Модуль GPS</li><li>Батарея 4S</li><li>Алюмінієва рама для кріплення двигунів квадрокоптера (квадратна труба 10х10 мм, стінка 1 мм)</li><li>TOW важить ~2.3кг з батареєю 4S на 4200mAh</li></ul><h2 id="структура" tabindex="-1">Структура <a class="header-anchor" href="#структура" aria-label="Permalink to &quot;Структура&quot;">​</a></h2><p>Структура виготовлена з алюмінієвих стрижнів, як показано нижче.</p><p><img src="'+i+'" alt="quadframe"><img src="'+o+'" alt="Fun Cub -frame for vtol mounted"></p><h2 id="підключення" tabindex="-1">Підключення <a class="header-anchor" href="#підключення" aria-label="Permalink to &quot;Підключення&quot;">​</a></h2><p>Motor and servo wiring is nearly entirely up to you, but should match the <a href="./../airframes/airframe_reference.html#vtol_standard_vtol_generic_standard_vtol">Generic Standard VTOL</a> configuration, as shown in the airframe reference. The geometry and output assignment can be configured in the <a href="./../config/actuators.html#actuator-outputs">Actuators Configuration</a></p><p>Наприклад, ви можете з’єднати його так, як у цьому прикладі (орієнтація як у &quot;сидячи в літаку&quot;):</p><table tabindex="0"><thead><tr><th>Порт</th><th>Підключення</th></tr></thead><tbody><tr><td>MAIN 1</td><td>Передній правий мотор (CCW)</td></tr><tr><td>MAIN 2</td><td>Задній лівий мотор (CCW)</td></tr><tr><td>MAIN 3</td><td>Передній лівий мотор (CW)</td></tr><tr><td>MAIN 4</td><td>Правий задній мотор (CW)</td></tr><tr><td>AUX 1</td><td>Лівий елерон TODO</td></tr><tr><td>AUX 2</td><td>Правий елерон</td></tr><tr><td>AUX 3</td><td>Elevator</td></tr><tr><td>AUX 4</td><td>Rudder</td></tr><tr><td>AUX 5</td><td>Тяга</td></tr></tbody></table><p>For further instructions on wiring and configurations please see: <a href="./../config_vtol/vtol_quad_configuration.html">Standard VTOL Wiring and Configuration</a>. </p><h2 id="конфігурація-планера" tabindex="-1">Конфігурація планера <a class="header-anchor" href="#конфігурація-планера" aria-label="Permalink to &quot;Конфігурація планера&quot;">​</a></h2><ol><li><p>For <a href="./../config/airframe.html">Airframe</a> select the vehicle group/type as <em>Standard VTOL</em> and the specific vehicle as <a href="./../airframes/airframe_reference.html#vtol_standard_vtol_generic_standard_vtol">Generic Standard VTOL</a> as shown below (do not forget to click <strong>Apply and Restart</strong> in the top).</p><p><img src="'+n+'" alt="QCG - Select Generic Standard VTOL"></p></li><li><p>Configure the outputs and geometry following the instructions in <a href="./../config/actuators.html">Actuators Configuration</a></p></li><li><p>За замовчуванням параметри часто достатні для стабільного польоту. For more detailed tuning information see <a href="./../config_vtol/vtol_quad_configuration.html">Standard VTOL Wiring and Configuration</a>.</p></li></ol><p>Після завершення калібрування, VTOL готовий до польоту.</p><h2 id="відео" tabindex="-1">Відео <a class="header-anchor" href="#відео" aria-label="Permalink to &quot;Відео&quot;">​</a></h2>',22),t("lite-youtube",{videoid:"4K8yaa6A0ks",title:"Fun Cub PX4 VTOL Maiden"},null,-1),t("h2",{id:"підтримка",tabindex:"-1"},[a("Підтримка "),t("a",{class:"header-anchor",href:"#підтримка","aria-label":'Permalink to "Підтримка"'},"​")],-1),t("p",null,[a("If you have any questions regarding your VTOL conversion or configuration please visit "),t("a",{href:"https://discuss.px4.io/c/px4/vtol",target:"_blank",rel:"noreferrer"},"https://discuss.px4.io/c/px4/vtol"),a(".")],-1)]))}const q=l(h,[["render",p]]);export{k as __pageData,q as default};
